import React from "react";
import "./Logo.css";

function Logo(props) {
  const { group, vector, vector2, vector3, vector4, vector5 } = props;

  return (
    <div className="logo">
      <div className="group2" style={{ backgroundImage: `url(${group})` }}></div>
      <img className="vector3" src={vector} />
      <img className="vector-15" src={vector2} />
      <img className="vector-24" src={vector3} />
      <img className="vector-33" src={vector4} />
      <img className="vector-43" src={vector5} />
    </div>
  );
}

export default Logo;
